import React from "react";
import axios from 'axios';
import {  Link,useNavigate } from 'react-router-dom'
import { useState, useEffect } from "react";
import Form from 'react-bootstrap/Form';
import './register.css'

export default function Register(props){

    const [isSignedUp, setIsSignedUp] = useState(false);

    const [state, setState] = useState({
        name:"",
        username:"",
        email: "",
        password: "",
        confirm_password:"",
    });
    const navigate=useNavigate();
    const [type,setType]=useState("");

    const handleInputChange = (event) => {
        const { name, value } = event.target;
        setState((prevProps) => ({
        ...prevProps,
        [name]: value
        }));
    };

    const handleSubmit = async (e) => {
        e.preventDefault();
        console.log(state);
        if(state.password===state.confirm_password){
            if (type=="seller"){
                try {
                    console.log(state)
                    const data={
                        name:state.name,
                        email:state.email,
                        password:state.password
                    }
                    console.log(data)
                    await axios.post("http://localhost:5000/sellers", data);
                    // setIsSignedUp(true);
                    navigate("/Product");
                } catch (error) {
                console.log(error);
                }
            }
            if(type=="customer"){
                try {
                    console.log(state)
                    const data={
                        name:state.name,
                        email:state.email,
                        password:state.password
                    }
                    console.log(data)
                    await axios.post("http://localhost:5000/customers", data);
                    // setIsSignedUp(true);
                    navigate("/Home");
                } catch (error) {
                console.log(error);
                }
            }
            if(type=="advertiser"){
                try {
                    console.log(state)
                    const data={
                        name:state.name,
                        email:state.email,
                        password:state.password
                    }
                    console.log(data)
                    await axios.post("http://localhost:5000/advertisers", data);
                    // setIsSignedUp(true);
                    navigate("/");
                } catch (error) {
                console.log(error);
                }
            }
            // else{
            //     alert("select user type")
            // }
        }else{
            console.log("password not matched");
        }
    };

    return(
        // <div>
        // {isSignedUp ? (
        //     <Product/>
        // ) : (
        <div className="register-body">
        <div class="wrapper">
         <div class="title-text">
            <div class="title signup">Signup</div>
         </div>
         <div class="form-container">
            <div class="form-inner">
               <form onSubmit={handleSubmit} class="signup">
                <div class="field">
                    <Form.Select aria-label="select user" value={type}  onChange={e => {
            console.log(e.target.value);
            setType(e.target.value);
          }} >
                    <option>User Type</option>
                    <option value="customer" >Customer</option>
                    <option value="seller" >Seller</option>
                    <option value="advertiser" >Advertiser</option>
                    </Form.Select>
                </div>
                  <div class="field">
                     <input type="text" placeholder="Name" name="name" value={state.name} 
              onChange={handleInputChange} required/>
                  </div>
                <div class="field">
                     <input type="text" placeholder="Username" name="username" value={state.username} 
              onChange={handleInputChange} required/>
                  </div>
                  <div class="field">
                     <input type="email" placeholder="Email Address" name="email" value={state.email} 
              onChange={handleInputChange} required/>
                  </div>
                  <div class="field">
                     <input type="password" placeholder="Password" name="password" value={state.password} 
              onChange={handleInputChange} required/>
                  </div>
                  <div class="field">
                     <input type="password" placeholder="Confirm password" name="confirm_password" value={state.confirm_password} 
              onChange={handleInputChange} required/>
                  </div>
                {/* <Link to={"/Product"}> */}
                  <div class="field btn-login">
                     <div class="btn-layer"></div>
                     <input type={"submit"} value="Signup"/>
                  </div>
                {/* </Link> */}
                <div class="signup-link">
                     Already have an account? <Link to={"/Login"}>Login</Link>
                  </div>
               </form>
            </div>
         </div>
      </div>
    </div>
        // )}
        // </div>
      
    );
}
